(812,174,"_elementor_data","[{\"id\":\"266317c\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"a6c7e60\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"943bc02\",\"elType\":\"widget\",\"settings\":{\"youtube_url\":\"https:\\/\\/www.youtube.com\\/watch?v=gOHnYE9mPTA&feature=youtu.be\",\"vimeo_url\":\"https:\\/\\/vimeo.com\\/235215203\",\"dailymotion_url\":\"https:\\/\\/www.dailymotion.com\\/video\\/x6tqhqb\"},\"elements\":[],\"widgetType\":\"video\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"e2f3124\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"38ff72a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[],\"isInner\":false}],\"isInner\":false},{\"id\":\"69b6df6\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"969b363\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"1144a7d\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>When I was young, I was the kid that would do nothing except play video games all day while eating nothing but junk food. McDonald\'s multiple times a week, chips and pop every night and I didn\'t really care for exercise. I played baseball for a couple of years when I was around 10 years old and lived back in Richmond Hill, then when I moved to Newmarket I got into Karate for another couple of years.\\u00a0<br \\/><br \\/>I realized that I really enjoyed physical activity, although my body remained the same due to the foods that I was eating.<br \\/><br \\/>In Grade 10 I decided to take my first Fitness course which introduced to me the gym. I loved just being able to forget about everything for the time I was in there and be able to focus on myself. I didn\'t have much going for me at the time, but I knew that if I stayed persistent with this that I\'d start to see changes.<br \\/><br \\/>Over time I started to notice gradual changes to my body. I started to see muscles forming, vascularity in my arms, you name it! This got me even more motivated to keep pushing.<br \\/><br \\/>In Grade 12, I took my first Nutrition course which gave a basic understanding of foods and what both macro-nutrients &amp; micro-nutrients are. I became hooked on this and finally understood why I stopped seeing more and more changes; my diet was still sub-par.<br \\/><br \\/>I started to apply what I had learned in this course and continued learning about fitness &amp; nutrition over the next 6 years to where I am today.\\u00a0<br \\/><br \\/>I feel like I have learned so much yet I still have so much to learn. I know am I not the most educated man on the planet on this subject, but I have a burning desire to help others achieve success with their bodies as well. There\'re not only physical changes required, but mental changes as well. You have to approach this situation (any situation at that) with a positive mindset and you will be unbelievably shocked at what you can actually achieve.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"26d7234\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"2d165f2\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[],\"isInner\":false}],\"isInner\":false},{\"id\":\"737d66f\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"84a2b7a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"a7341ca\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/darien-matt-fitness.local\\/wp-content\\/uploads\\/2019\\/01\\/PhotoSidewalk.jpg\",\"id\":24},\"image_size\":\"medium_large\"},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"538904c\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"16e7248\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"a74185c\",\"elType\":\"widget\",\"settings\":[],\"elements\":[],\"widge