 changes to my body. I started to see muscles forming, vascularity in my arms, you name it! This got me even more motivated to keep pushing.<br \\/><br \\/>In Grade 12, I took my first Nutrition course which gave a basic understanding of foods and what both macro-nutrients &amp; micro-nutrients are. I became hooked on this and finally understood why I stopped seeing more and more changes; my diet was still sub-par.<br \\/><br \\/>I started to apply what I had learned in this course and continued learning about fitness &amp; nutrition over the next 6 years to where I am today.\\u00a0<br \\/><br \\/>I feel like I have learned so much yet I still have so much to learn. I know am I not the most educated man on the planet on this subject, but I have a burning desire to help others achieve success with their bodies as well. There\'re not only physical changes required, but mental changes as well. You have to approach this situation (any situation at that) with a positive mindset and you will be unbelievably shocked at what you can actually achieve.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"26d7234\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"2d165f2\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[],\"isInner\":false}],\"isInner\":false},{\"id\":\"737d66f\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"84a2b7a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"a7341ca\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/darien-matt-fitness.local\\/wp-content\\/uploads\\/2019\\/01\\/PhotoSidewalk.jpg\",\"id\":24},\"image_size\":\"medium_large\"},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"538904c\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"16e7248\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"a