(860,182,"_elementor_data","[{\"id\":\"266317c\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"a6c7e60\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[],\"isInner\":false}],\"isInner\":false},{\"id\":\"8680521\",\"elType\":\"section\",\"settings\":{\"background_background\":\"classic\",\"background_color\":\"#fff9f9\"},\"elements\":[{\"id\":\"0310878\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"9235702\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/darien-matt-fitness.local\\/wp-content\\/uploads\\/2019\\/01\\/change.jpg\",\"id\":177}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"69b6df6\",\"elType\":\"section\",\"settings\":{\"background_background\":\"classic\",\"background_color\":\"#ffffff\"},\"elements\":[{\"id\":\"969b363\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"1144a7d\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>When I was young, I was the kid that would do nothing except play video games all day while eating nothing but junk food. McDonald\'s multiple times a week, chips and pop every night and I didn\'t really care for exercise.<\\/p><p>I played baseball for a couple of years when I was around 10 years old and lived back in Richmond Hill, then when I moved to Newmarket I got into Karate for another couple of years. I realized that I really enjoyed physical activity, although my body remained the same due to the foods that I was eating.<\\/p><p>In Grade 10 I decided to take my first Fitness course which introduced to me the gym. I loved just being able to forget about everything for the time I was in there and be able to focus on myself. I didn\'t have much going for me at the time, but I knew that if I stayed persistent with this that I\'d start to see changes.<\\/p><p>Over time I started to notice gradual changes to my body. I started to see muscles forming, vascularity in my arms, you name it! This got me even more motivated to keep pushing.<\\/p><p>In Grade 12, I took my first Nutrition course which gave a basic understanding of foods and what both macro-nutrients &amp; micro-nutrients are. I became hooked on this and finally understood why I stopped seeing more and more changes; my diet was still sub-par.<\\/p><p>I started to apply what I had learned in this course and continued learning about fitness &amp; nutrition over the next 6 years to where I am today.<\\/p><p>I feel like I have learned so much yet I still have so much to learn. I know am I not the most educated man on the planet on this subject, but I have a burning desire to help others achieve success with their bodies as well. There\'re not only physical changes required, but mental changes as well. You have to approach this situation (any situation at that) with a positive mindset and you will be unbelievably shocked at what you can actually achieve.<\\/p>\",\"text_color\":\"#000000\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Arial\",\"typography_font_size\":{\"unit\":\"px\",\"size\":16},\"typography_font_weight\":\"700\",\"typography_font_style\":\"normal\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"26d7234\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"2d165f2\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[],\"isInner\":false}],\"isInner\":false},{\"id\":\"737d66f\",\"elType\":\"section\",\"settings\":{\"background_background\":\"classic\",\"background_color\":\"#fff9f9\"},\"elements\":[{\"id\":\"84a2b7a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"a7341ca\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/darien-matt-fitness.local\\/wp-content\\/uploads\\/2019\\/01\\/PhotoSidewalk.jpg\",\"id\":24},\"image_size\":\"medium_large\"},\"elements\":[],\"widgetType\":\"image\